import React from 'react'
import Navbar from '../../components/navbar'
import Project from '../../components/project'
import './projects'
import {Segment, Container, Image, Divider, Icon, Grid} from 'semantic-ui-react'

const projects = [
    {
        text: "This One", 
        description: "Virtual Hostel is a community where travelers can share their experiences. Hostel bulletin boards are a great place to see what a city has to offer, and Virtual Hostel lets browse these adventures before you set off on your adventures.",
        skills: [
            {src:"react.png", text:"React"},
            {src:"graphql.png", text:"GraphQL"},
            {src:"node.jpeg", text:"Node"}
        ],
        link:"http://www.fillmurray.com/",
        github: "https://www.placecage.com/",
        image: "campaignquery.jpeg"
    }
]


const Projects = () => {
    return(
        <>
            <Navbar/>
                <Grid doubling stackable columns={2} >
                    <Grid.Row>
                        {projects.map(project => (
                            <Project image={project.image} text={project.text} description={project.description} skills={project.skills} link={project.link} github={project.github}/>
                        ))}
                    </Grid.Row>
                </Grid>
        </>
    )
}

export default Projects
